import './Panel.css'
import paperBin from '../../resources/paper-bin_5867779.png'



const Panel = () => {
    return(
        <div className='panel'>
            <input type="text" />
            <button className='addTask'>add task</button>
            <img className='paperBin' src={paperBin} alt="paper bin" />
        </div>
    )
}

export default  Panel
